tables.table_schema:
CREATE TABLE ModelTraining (
    train_data_id UUID PRIMARY KEY,
    model_id UUID,
    training_status VARCHAR(50)
);

CREATE TABLE InferenceResults (
    result_id UUID PRIMARY KEY,
    inference_data_id UUID,
    model_id UUID,
    inference_result VARCHAR(255)
);

CREATE TABLE TransactionsLog (
    transaction_id UUID PRIMARY KEY,
    transaction_type VARCHAR(50),
    transaction_timestamp TIMESTAMP
);

CREATE TABLE train_data (
  id INT PRIMARY KEY,
  data VARCHAR(255),
  label VARCHAR(50)
);

CREATE TABLE inference_data (
  id INT PRIMARY KEY,
  data VARCHAR(255),
  prediction VARCHAR(50)
);

CREATE TABLE model_history (
  id INT PRIMARY KEY,
  model_name VARCHAR(50),
  training_accuracy FLOAT
);

CREATE TABLE transaction_log (
  transaction_id INT PRIMARY KEY,
  timestamp TIMESTAMP,
  operation VARCHAR(50)
);

CREATE TABLE User (
    user_id INT PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    email VARCHAR(100) UNIQUE,
    created_at TIMESTAMP NOT NULL
);

CREATE TABLE TrainingData (
    data_id INT PRIMARY KEY,
    model_id INT NOT NULL,
    data_file BYTEA NOT NULL,
    created_at TIMESTAMP NOT NULL
);

CREATE TABLE TransactionLog (
    log_id INT PRIMARY KEY,
    transaction_type VARCHAR(50) NOT NULL,
    transaction_time TIMESTAMP NOT NULL
);
